const BigProjects = 'BigProjects';

const initialState = {
    carts: [
        {
            imgSrc: 'http://localhost:3000/static/media/itworld.am.0421630e.png',
            imgAlt: "itworld's image",
            name: 'itWorld',
            description: 'Lorem ipsum dolor sit amet, consectetur adipisicing elit.'
        },
        {
            imgSrc: 'http://localhost:3000/static/media/avto.f4cc7fd6.jpg',
            imgAlt: "avto's image",
            name: 'Avto',
            description: 'Lorem ipsum dolor sit amet, consectetur adipisicing elit.'
        },
    ]
}

export default function BigProjectsReducer(state = initialState, action) {

    switch (action.type) {
        default:
            return state;
    }
}
